import { Link } from "react-router-dom";
import "./Navbar.css";

const Navbar = () => {
  return (
    <>
      <div className="navbar-container">
        climb on
        <div className="navbar-container-links">
          <Link to="/">home</Link>
          <Link to="/about">about</Link>
          <Link to="/mappage">map</Link>
        </div>
      </div>
    </>
  );
};

export default Navbar;
